import  React, {useState} from 'react';
import { makeStyles } from '@mui/material/styles';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import MenuItem from '@mui/material/MenuItem';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';
import PeopleIcon from '@mui/icons-material/People';
import Collapse from "@mui/material/Collapse";
import BusinessIcon from '@mui/icons-material/Business';
import Box from '@mui/material/Box';
import Badge from '@mui/material/Badge';
import MailIcon from '@mui/icons-material/Mail';
import NotificationsIcon from '@mui/icons-material/Notifications';
import MoreIcon from '@mui/icons-material/MoreVert';
import SideDrawerMenu from './Sidemenu';
import Avatar from '@mui/material/Avatar';
import Stack from '@mui/material/Stack';
import DashboardTable from './Table';

import MoveToInboxIcon from '@mui/icons-material/MoveToInbox';
import HomeIcon from '@mui/icons-material/Home';
import ExpandLess from "@mui/material/ExpandLess";
import ExpandMore from "@mui/material/ExpandMore";


const useStyles = makeStyles((theme) => ({
    root: { flexGrow: 1 },
    menuButton: { marginRight: theme.spacing(2) },
    title: { flexGrow: 1 },
    list: { width: 250 },
    nested: { paddingLeft: theme.spacing(4) }
  }));

  const Dashboard = () => {
    const [drawerOpen, setDrawerOpen] = useState(false);
    const [anchorEl, setAnchorEl] = useState(null);

    const [leadershipTriadMenuOpen, setLeadershipTriadMenuOpen] = useState(false);

    const handleLeadershipTriadClick = () => {
      setLeadershipTriadMenuOpen(!leadershipTriadMenuOpen);
    };

    const handleClick = (event) => {
      setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
      setAnchorEl(null);
    };

    const toggleDrawer = () => {
      setDrawerOpen(!drawerOpen);
    };
    const classes = useStyles();
    return (
      <div className={classes.root}>
        <AppBar position="static">
          <Toolbar>
            <IconButton
              edge="start"
              className={classes.menuButton}
              color="inherit"
              aria-label="menu"
              onClick={() => toggleDrawer()}
            >
              <MenuIcon />
              <Drawer
                anchor="left"
                open={drawerOpen}
                onClose={() => toggleDrawer()}
              >
                <div className={classes.list}>
                  <List>
                    <ListItem button>
                      <ListItemIcon>
                        <HomeIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Home" />
                    </ListItem>
                    <ListItem button onClick={() => handleLeadershipTriadClick()}>
                      <ListItemIcon>
                        <HomeIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Leadership Triad" />
                      {leadershipTriadMenuOpen ? <ExpandLess /> : <ExpandMore />}
                    </ListItem>
                    <Collapse
                      in={leadershipTriadMenuOpen}
                      timeout="auto"
                      unmountOnExit
                    >
                      <List component="div" disablePadding>
                        <ListItem button className={classes.nested}>
                          <ListItemIcon>
                            <HomeIcon />
                          </ListItemIcon>
                        </ListItem>
                      </List>
                    </Collapse>
                    <ListItem button>
                      <ListItemIcon>
                        <InboxIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Testing" />
                    </ListItem>
                    <ListItem button>
                      <ListItemIcon>
                        <InboxIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Testing" />
                    </ListItem>
                  </List>
                  <Divider />
                  <List>
                    <ListItem button>
                      <ListItemIcon>
                        <BusinessIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Companies" />
                    </ListItem>
                    <ListItem button>
                      <ListItemIcon>
                        <PeopleIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Users" />
                    </ListItem>
                  </List>
                  <Divider />
                  <List>
                    <ListItem button>
                      <ListItemIcon>
                        <AccountCircleIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Profile" />
                    </ListItem>
                    <ListItem button>
                      <ListItemIcon>
                        <ExitToAppIcon color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Logout" />
                    </ListItem>
                  </List>
                </div>
              </Drawer>
            </IconButton>
            <Typography variant="h6" className={classes.title}>
              Leadership Program
            </Typography>
            <IconButton color="inherit" onClick={handleClick}>
              <AccountCircleIcon />
            </IconButton>
            <Menu
              id="admin-menu"
              anchorEl={anchorEl}
              keepMounted
              open={Boolean(anchorEl)}
              onClose={handleClose}
            >
              <MenuItem onClick={handleClose}>Profile</MenuItem>
              <MenuItem onClick={handleClose}>Logout</MenuItem>
            </Menu>
          </Toolbar>
        </AppBar>
      </div>
    );
  };

  export default Dashboard;

